import React from 'react';
import LoadingPage from './comp/LoadingPage';
import GlobalMap from './comp/GlobalMap';
import './App.css';

const App = () => {
    const isLoading = true; // Change this based on your loading logic

    return (
        <div className="App">
            {isLoading ? (
                <LoadingPage />
            ) : (
                <>
                    <h1>Interactive Map with Popup Cards</h1>
                    <GlobalMap />
                </>
            )}
        </div>
    );
};

export default App;
